import React from 'react';
import './App.css';
import Homepage from './pages/Homepage/Homepage';
import {Route} from 'react-router-dom';

const HatsPage = () => {
	<div>
		<h1>Hats Page</h1>
	</div>
}

function App() {
  return (
    <div className="App">
      <Route exact={true} path='/' component={Homepage}/>
    </div>
  );
}

export default App;
